entite_109.text:
Vous dont les nids soyeux vont se changer en tombes ;
— 10 —
Roses

entite_2088.text:
Qui se gravent sans peine en vos jeunes mémoires ;
Vous aimez les récits naïfs et merveilleux
Qui font battre le coeur et pleurer vos beaux yeux

entite_2809.text:
Au moindre cri sorti de votre belle bouche ;
Vous prenant dans ses bras pour apaiser vos pleurs
Et vous faire oublier vos petites douleurs
